import supabase from"@/lib/supabase";export async function listSleep(e){const{data:r,error:t}=await supabase.from("sleep_data").select("*").eq("user_id",e).order("start_time",{ascending:!1}).limit(365);if(t)throw t;return r||[]}export async function insertSleep(e){const{error:r}=await supabase.from("sleep_data").insert(e);if(r)throw r;return!0}